import React, { useEffect, useState } from "react";
import {
  Container,
  Typography,
  Card,
  CardMedia,
  CardContent,
  IconButton,
  Button,
  Box,
  Divider,
  MenuItem,
  TextField
} from "@mui/material";
import DeleteIcon from "@mui/icons-material/Delete";
import AddIcon from "@mui/icons-material/Add";
import RemoveIcon from "@mui/icons-material/Remove";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import { Link } from "react-router-dom";

function Cart() {
  const [cart, setCart] = useState([]);
  const [subtotal, setSubtotal] = useState(0);
  const [shippingMethod, setShippingMethod] = useState("");
  const [shippingCost, setShippingCost] = useState(0);
  const [total, setTotal] = useState(0);

  // Datos de facturaciÃ³n
  const [billingInfo, setBillingInfo] = useState({
    ruc: "",
    razonSocial: "",
    nombreCompleto: ""
  });

  // ðŸ“Œ Cargar carrito
  useEffect(() => {
    const savedCart = JSON.parse(localStorage.getItem("cart")) || [];
    setCart(savedCart);
  }, []);

  // ðŸ“Œ Calcular subtotal y total
  useEffect(() => {
    const subtotalCalc = cart.reduce((sum, item) => sum + item.price * item.quantity, 0);
    setSubtotal(subtotalCalc);
    setTotal(subtotalCalc + shippingCost);
  }, [cart, shippingCost]);

  // ðŸ“Œ Aumentar cantidad
  const increaseQuantity = (index) => {
    const updatedCart = [...cart];
    updatedCart[index].quantity += 1;
    setCart(updatedCart);
    localStorage.setItem("cart", JSON.stringify(updatedCart));
  };

  // ðŸ“Œ Disminuir cantidad
  const decreaseQuantity = (index) => {
    const updatedCart = [...cart];
    if (updatedCart[index].quantity > 1) {
      updatedCart[index].quantity -= 1;
    }
    setCart(updatedCart);
    localStorage.setItem("cart", JSON.stringify(updatedCart));
  };

  // ðŸ“Œ Eliminar producto
  const removeItem = (index) => {
    const updatedCart = cart.filter((_, i) => i !== index);
    setCart(updatedCart);
    localStorage.setItem("cart", JSON.stringify(updatedCart));
  };

  // ðŸ“Œ Manejar cambio en tipo de envÃ­o
  const handleShippingChange = (event) => {
    const method = event.target.value;
    setShippingMethod(method);
    if (method === "Olva") setShippingCost(15);
    else if (method === "Shalom") setShippingCost(20);
    else setShippingCost(0);
  };

  // ðŸ“Œ Manejar datos de facturaciÃ³n
  const handleBillingChange = (e) => {
    setBillingInfo({
      ...billingInfo,
      [e.target.name]: e.target.value
    });
  };

  return (
    <Container sx={{ mt: 4, mb: 6 }}>
      <Typography variant="h4" gutterBottom sx={{ fontWeight: "bold", color: "#333", display: "flex", alignItems: "center" }}>
        <ShoppingCartIcon sx={{ mr: 1, fontSize: 32, color: "#1976d2" }} />
        Carrito de Compras
      </Typography>

      {cart.length === 0 ? (
        <Typography variant="h6" sx={{ color: "#777", mt: 3 }}>
          Tu carrito estÃ¡ vacÃ­o.  
          <Link to="/" style={{ textDecoration: "none", color: "#1976d2" }}>Ir a la tienda</Link>
        </Typography>
      ) : (
        <>
          {cart.map((item, index) => (
            <Card
              key={index}
              sx={{
                display: "flex",
                alignItems: "center",
                mb: 2,
                boxShadow: 4,
                borderRadius: 2,
                transition: "0.3s",
                "&:hover": { boxShadow: 8 }
              }}
            >
              <CardMedia
                component="img"
                sx={{
                  width: 140,
                  height: 140,
                  objectFit: "contain",
                  backgroundColor: "#f9f9f9",
                  borderRight: "1px solid #eee"
                }}
                image={item.image}
                alt={item.name}
              />
              <CardContent sx={{ flexGrow: 1 }}>
                <Typography variant="h6" sx={{ fontWeight: "bold" }}>{item.name}</Typography>
                <Typography variant="body1" sx={{ color: "#1976d2", fontWeight: "bold" }}>
                  S/ {item.price.toFixed(2)}
                </Typography>

                <Box sx={{ display: "flex", alignItems: "center", mt: 1 }}>
                  <Typography variant="body2" sx={{ mr: 1, fontWeight: "bold" }}>
                    Cantidad:
                  </Typography>
                  <IconButton onClick={() => decreaseQuantity(index)} size="small" sx={{ backgroundColor: "#eee", "&:hover": { backgroundColor: "#ddd" } }}>
                    <RemoveIcon />
                  </IconButton>
                  <Typography variant="body1" sx={{ mx: 1, minWidth: "24px", textAlign: "center" }}>
                    {item.quantity}
                  </Typography>
                  <IconButton onClick={() => increaseQuantity(index)} size="small" sx={{ backgroundColor: "#eee", "&:hover": { backgroundColor: "#ddd" } }}>
                    <AddIcon />
                  </IconButton>

                  <IconButton onClick={() => removeItem(index)} color="error" sx={{ ml: 2 }}>
                    <DeleteIcon />
                  </IconButton>
                </Box>
              </CardContent>
            </Card>
          ))}

          <Divider sx={{ my: 3 }} />

          {/* EnvÃ­o */}
          <Typography variant="h6" gutterBottom sx={{ fontWeight: "bold" }}>
            MÃ©todo de EnvÃ­o
          </Typography>
          <TextField
            select
            value={shippingMethod}
            onChange={handleShippingChange}
            label="Selecciona el envÃ­o"
            fullWidth
            sx={{ mb: 3 }}
          >
            <MenuItem value="">-- Seleccionar --</MenuItem>
            <MenuItem value="Olva">Delivery - Olva: S/15.00</MenuItem>
            <MenuItem value="Shalom">Delivery - Shalom: S/20.00</MenuItem>
          </TextField>

          {/* FacturaciÃ³n */}
          <Typography variant="h6" gutterBottom sx={{ fontWeight: "bold" }}>
            Datos de FacturaciÃ³n (Opcional)
          </Typography>
          <TextField
            label="RUC"
            name="ruc"
            value={billingInfo.ruc}
            onChange={handleBillingChange}
            fullWidth
            sx={{ mb: 2 }}
          />
          <TextField
            label="RazÃ³n Social"
            name="razonSocial"
            value={billingInfo.razonSocial}
            onChange={handleBillingChange}
            fullWidth
            sx={{ mb: 2 }}
          />
          <TextField
            label="Nombre Completo"
            name="nombreCompleto"
            value={billingInfo.nombreCompleto}
            onChange={handleBillingChange}
            fullWidth
            sx={{ mb: 3 }}
          />

          {/* Resumen */}
          <Box
            sx={{
              backgroundColor: "#f5f5f5",
              padding: "16px",
              borderRadius: 2,
              boxShadow: 2,
              mb: 3
            }}
          >
            <Typography variant="body1" sx={{ mb: 1 }}>
              Subtotal: <strong>S/ {subtotal.toFixed(2)}</strong>
            </Typography>
            <Typography variant="body1" sx={{ mb: 1 }}>
              EnvÃ­o: <strong>S/ {shippingCost.toFixed(2)}</strong>
            </Typography>
            <Typography variant="h6" sx={{ fontWeight: "bold", mt: 1 }}>
              Total: S/ {total.toFixed(2)}
            </Typography>
          </Box>

          {/* BotÃ³n de pago */}
          <Button
            variant="contained"
            color="primary"
            size="large"
            component={Link}
            to="/checkout"
            sx={{
              padding: "10px 20px",
              fontSize: "16px",
              fontWeight: "bold",
              borderRadius: "8px"
            }}
          >
            Proceder al pago
          </Button>
        </>
      )}
    </Container>
  );
}

export default Cart;
